import "./topbar.scss"


export default function Topbar() {
  return(
     <div className="topbar">
           <div className="wrapper">
             <div className="left">
               <a href="#intro"></a>
             </div>
            <div className="right"></div>
             
           </div>
     </div>
  )
}
